import React from "react";



function NavBar() {
    const navbarStyle = {
      backgroundColor: '#333',
      color: 'white',
      padding: '10px',
      textAlign: 'center',
    };

    const linkStyle = {
      color: 'white',
      margin: '0 10px',
      textDecoration: 'none',
    };

    return (
      <div style={navbarStyle}>
        <a href="/" style={linkStyle}>Home</a>
        <a href="/about" style={linkStyle}>About</a>
        <a href="/contact" style={linkStyle}>Contact</a>
      </div>
    );
  }

export default NavBar;
